const React = require('react');

class Timer extends React.Component {
    constructor(props){
        super(props);
        this.state ={
            timerOn: false,
            timerStart: 0,
            timerTime: 0
        };
    }
    render() {
        return (
            <div className="Countdown-timer">
                <div className="Countdown-header">Countdown</div>
            </div>
        );
    }
}
export default Timer;
